import React from 'react';
// @ts-ignore
import classes from "./Title.module.css"
// @ts-ignore
const title = (props) => {
    return (
        <div className={classes.Title}>
            <p>Hi I'm Chris Lim</p>
        </div>
    )
}
export default title;
